import React from "react";
import style from "./footer.module.css";

const Footer = () => {
    <div className={style.containerFooter}>
            <ul>
                <li>
                <a href="https://github.com/GEdgardoFernandez">Github</a>
                </li>
                <li>
                <a href="https://www.linkedin.com/in/guillermo-fern%C3%A1ndez-703b50267">Linkedin</a>
                </li>
            </ul>
    </div>
}

export default Footer;
